import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, SafeAreaView } from "react-native";

export default function App() {
  return (
    <SafeAreaView style={styles.body}>
      <View style={styles.container}>
        <h1>
          <Text>Aplikacja Ratowników Mazowsza</Text>
        </h1>
        <ul style={styles.user}>
          <li>
            <Text>Pierwszy użytkownik</Text>
            <Text>Czy dostępny: </Text>
          </li>
          <li>
            <Text>Drugi użytkownik</Text>
            <Text>Czy dostępny: </Text>
          </li>
        </ul>
        <View>
          <Button onPress={basicFunction}>
            <Text>Naciśnij mnie</Text>
          </Button>
        </View>
        <StatusBar style="auto" />
      </View>
    </SafeAreaView>
  );
}

function basicFunction() {
  console.log("abc");
}

const styles = StyleSheet.create({
  body: {
    width: "50%",
    height: "90%",
    borderColor: "red",
    borderWidth: "2px",
    borderRadius: "5px",
    marginLeft: "auto",
    marginRight: "auto",
    backgroundColor: "dodgerblue",
    flex: 1,
  },
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  user: {
    flex: 1,
    borderWidth: "1px",
    borderRadius: "5px",
  },
});
